        <div id="e0" style="position:absolute;left:1;top:0;width:998;height:78;"><!--$img %ImageAssetImpl:/images/generic_dusk_header.jpg$--><img src="sitebuilder/images/generic_dusk_header-998x78.jpg" width="998" height="78" alt=""></div>        <div id="e1" style="position:absolute;left:1;top:78;width:998;height:44;"><img src="images/generic_dusk_search_bar_background_tile.gif" width="998" height="44" alt=""></div>        <div id="e2" style="position:absolute;left:150;top:25;width:586;height:40;"><span class="text"><font color="#D4A84B" size="6"><span style="font-size:30px;line-height:35px;">Dojo Rules - Niju Kun<br/></span></font></span>        </div>
        <div id="e3" style="position:absolute;left:155;top:173;width:675;height:644;"><span class="text"><ol start="1" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Dojo nomino karate to omou na.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate is not only for dojo training.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="2" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">K</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">arate-do wa rei ni hajimari, rei ni owaru koto wo wasuruna.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate begins and ends with a bow.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="3" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate ni sente nashi.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"> There is no first attack in karate.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="4" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate wa gi no tasuke.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">One who practices karate follows the ways of justice.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="5" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Mazu jiko wo shire, shikoshite tao wo shire.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"> First know your self; then know others.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="6" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Gijutsu yori shinjutsu.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Kime first; technique second.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="7" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Kokoro wa hanatan koto wo yosu.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Release your mind.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="8" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Wazawai wa getai ni shozu.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Misfortune is a result of laziness.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="9" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate no shugyo wa issho de aru.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">I</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">t takes a lifetime to learn karate.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="10" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Arai-yuru mono wo karate-ka seyo, soko ni myo-mi ari.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Make karate a part of everyday life.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="11" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate wa yu no goto shi taezu natsudo wo ataezareba moto no mizu ni kaeru.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Karate is like hot water. If you do not heat it, it grows cold.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="12" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Katsu kangae wa motsu na makenu kangae wa hitsuyo.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Do not focus on winning; focus on not losing.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="13" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Tekki ni yotte tenka seyo.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Victory depends on t</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">elling vulnerable points from non-vulnerable ones.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="14" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Tattakai wa kyo-jitsu no soju ikan ni ari.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Move according to your opponent.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="15" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Hito no te ashi wo ken to omoe.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Consider your hands and feet as sharp swords.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="16" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Danshi mon wo izureba hyakuman no tekki ari.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">When you leave home, imagine millions of opponents are waiting to attack you.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="17" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Kamae wa shoshinsha ni ato wa shizentai.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"> Ready position for beginners; natural position for advanced.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="18" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Kata wa tadashiku jissen wa betsu mono.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Kata is one thing; a real fight is another.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="19" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Chikara no kyojaku, karada no shinshuku, waza no kankyu wo wasaruna.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Remember: strength and weakness of power; expansion and contraction of body; slowness and speed <br/></span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">of techniques.</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ul><ol start="20" style="padding:0;margin:0px 0px 0px 40px;"><li style="line-height:0px;color:#979BA0;font-size:12px;font-family:Arial;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Tsune ni shinen kufu seyo</span></font></i></b><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;"><br></span></font></i></b></ol><ul type="" style="padding:0;margin:0px 0px 0px 80px;"><b><i><font face="Arial" color="#979BA0" size="2"><span style="font-size:12px;line-height:15px;">Always create and devise.<br/></span></font></i></b></ul></span>        </div>
